// src/pages/Experiencia.js
import React from 'react';
import '../styles/experiencia.css';   // 1) Copia aquÃ­ tu antiguo styles.css o crea uno nuevo
import okumaImg from '../assets/okuma5ax.webp';
import powermillImg from '../assets/powermill.jpg';
import tsugamiImg from '../assets/tsugami.webp';
import solidworksImg from '../assets/solidworks.webp';
import rhino3dImg from '../assets/rhino3d.png';
import { useEffect } from 'react';
import ScrollReveal from 'scrollreveal';



export default function Experiencia() {

useEffect(() => {
  ScrollReveal().reveal('.inicio', { /* tus opciones */ });
}, []);


  return (
    <div className="experiencia-page">
      {/* Bloque 1 */}
      <section className="inicio">
        <div className="texto-inicio">
          <h3>Operador fresas CNC</h3>
          <div className="linea"></div>
          <h3>Techshop Internacional S.A.</h3>
          <p className="fecha">
            <i className="bx bx-time"></i>
            <span>Diciembre 2023</span> â <span>Actualidad</span>
          </p>
          <p>
            <i className="bx bx-spreadsheet"></i> OperaciÃ³n de centros de
            mecanizado de 3, 4 y 5 ejes con controles <b>Haas</b>, <b>Fanuc</b> y
            <b>Okuma</b>.
          </p>
          <p>
            <i className="bx bx-stats"></i> Piezas para industria petrolera e
            industria aeroespacial.
          </p>
          <p>
            <i className="bx bxs-component"></i> Materiales: Inconel, Monel,
            Cobre-Berilio.
          </p>
          <p>
            <i className="bx bx-map"></i> San JosÃ©, Costa Rica
          </p>
          <div className="main-btn">
            <a href="https://tsicr.com/" target="_blank" rel="noreferrer" className="btn">
              Ver empresa
            </a>
          </div>
          <div className="lineaGruesa"></div>
        </div>
        <div className="img-xp">
          <img src={okumaImg} alt="Okuma 5 ejes" />
        </div>
      </section>

      {/* Bloque 2 */}
      <section className="inicio">
        {/* â¦repite la misma estructura que antesâ¦ */}
        <div className="texto-inicio">
          <h3>Programador fresas CNC</h3>
          <div className="linea"></div>
          <h3>Industrias F &amp; L SRL.</h3>
          <p className="fecha">
            <i className="bx bx-time"></i> Octubre 2021 â Diciembre 2022
          </p>
          <p>
            <i className="bx bx-spreadsheet"></i> ProgramaciÃ³n con CAM <b>PowerMill</b>â¦
          </p>
          {/* etc. */}
        </div>
        <div className="img-xp-soft">
          <img src={powermillImg} alt="PowerMill" />
        </div>
      </section>

      {/* â¦y asÃ­ sucesivamente para cada bloque de experienciaâ¦ */}


    </div>
  );
}
